INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3000, 1000, 1, "調子が上がって\nきたなっ", 2, "vo_minigame_1013_icon_1_002_001", 2, "vo_minigame_1013_icon_2_002_001", "訓練はまだ\nここからですわ");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (2, 3000, 5000, 2, "ほらほら、\nまだいけるだろ？", 2, "vo_minigame_1013_icon_1_003_001", 2, "vo_minigame_1013_icon_2_003_001", "クスクス、悪くない\n流れですわね");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3000, 10000, 3, "へへっ、おまえら\nやるじゃねえか！", 2, "vo_minigame_1013_icon_1_004_001", 2, "vo_minigame_1013_icon_2_004_001", "すばらしい\n記録ですわ");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3000, 10000, 4, "あたしたちはまだ\n止まらねえぜ！", 2, "vo_minigame_1013_icon_1_005_001", 3, "vo_minigame_1013_icon_2_005_001", "乗りに乗って\nいますわね");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3000, 10000, 5, "見てろよ！\nマコト班の快進撃だ！", 2, "vo_minigame_1013_icon_1_005_002", 3, "vo_minigame_1013_icon_2_005_002", "まだまだ行きます\nついてきなさい");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3000, 10000, 6, "うおぉぉっ！\n絶好調だぜ！", 2, "vo_minigame_1013_icon_1_005_003", 3, "vo_minigame_1013_icon_2_005_003", "エリコ班の\n本領発揮ですわ！");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 3000, 0, 7, "どこまで行けるか\n楽しみだなっ！", 2, "vo_minigame_1013_icon_1_006_001", 4, "vo_minigame_1013_icon_2_006_001", "ここからは\n前人未到の領域です！");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (4, 1000, 1, 8, "まだ諦めんなよっ", 3, "vo_minigame_1013_icon_1_007_001", 5, "vo_minigame_1013_icon_2_007_001", "厄介でしたわ…");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (4, 1000, 1, 9, "冷やっとしたぜ…！", 3, "vo_minigame_1013_icon_1_007_002", 5, "vo_minigame_1013_icon_2_007_002", "油断大敵です");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (4, 1000, 1, 10, "弱音を吐くなっ", 3, "vo_minigame_1013_icon_1_007_003", 5, "vo_minigame_1013_icon_2_007_003", "忌々しいっ…");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 1500, 99, 11, "マコト班集合！", 4, "vo_minigame_1013_icon_1_008_001", 6, "vo_minigame_1013_icon_2_008_001", "大所帯ですわね");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (3, 1500, 99, 12, "連携してくぞ！", 4, "vo_minigame_1013_icon_1_008_002", 6, "vo_minigame_1013_icon_2_008_002", "エリコ班へようこそ");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (6, 3000, 0, 13, "みんなに力を！", 1, "vo_minigame_1013_icon_1_020_001", 8, "vo_minigame_1013_icon_2_020_001", "ナナカちゃんに\nお任せあれ");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (7, 3000, 0, 14, "任せてくれたまえ", 1, "vo_minigame_1013_icon_1_022_001", 9, "vo_minigame_1013_icon_2_022_001", "はっはっは！\n任せろ！");
INSERT INTO `v1_7477c390e7b6de58ba35dcf44158c2719e9ba639c3e008dbaf0bd7bec67b96ab` VALUES (8, 3000, 0, 15, "ほな、いきまひょか", 1, "vo_minigame_1013_icon_1_023_001", 10, "vo_minigame_1013_icon_2_023_001", "どんどんいくわよ");
